commit_message:
extract self() method to avoid too many unchecked @SuppressWarnings

Motivation:

There are many @SuppressWarnings("unchecked") in the code for the same purpose that we want to do this return:

@SuppressWarnings("unchecked")
public B someMethod() {
    ......
    return (B) this;
}
Modification:

Add a method self() and reuse in all these return lines:

@SuppressWarnings("unchecked")
    private B self() {
        return (B) this;
    }
Result:

Then only one @SuppressWarnings("unchecked") left in the code.

Changed check for superclass == Object.class to superclass != null;
it's the same check, except this one also works if you pass an Object.class; previously it NullPointered;

As a side effect you can now also get fields from Object.class, although that has limited use.
